// SongLabAI - Calendly Events Processing
// Process Calendly events and identify new bookings

const input = $input.first();
const newEvents = [];

if (!input.json.collection || !Array.isArray(input.json.collection)) {
  console.log('No events found in Calendly response');
  return [];
}

const events = input.json.collection;
console.log(`Processing ${events.length} Calendly events`);

for (const event of events) {
  try {
    // Extract event details
    const eventData = {
      calendly_event_id: event.uri.split('/').pop(),
      calendly_event_uri: event.uri,
      event_name: event.name,
      start_time: event.start_time,
      end_time: event.end_time,
      duration_minutes: Math.round((new Date(event.end_time) - new Date(event.start_time)) / (1000 * 60)),
      timezone: event.timezone || 'America/Los_Angeles',
      location: event.location ? (event.location.location || event.location.join_url || 'Virtual') : 'TBD',
      event_status: event.status || 'scheduled',

      // Event type detection
      meeting_type: detectMeetingType(event.name),

      // Metadata
      created_at: event.created_at,
      updated_at: event.updated_at,
      raw_event: event
    };

    newEvents.push(eventData);

  } catch (error) {
    console.error('Error processing Calendly event:', error);
  }
}

// Helper function to detect meeting type
function detectMeetingType(eventName) {
  const name = (eventName || '').toLowerCase();

  if (name.includes('auto') || name.includes('car') || name.includes('dealer')) {
    return 'automotive_consultation';
  } else if (name.includes('restaurant') || name.includes('food')) {
    return 'restaurant_consultation';
  } else if (name.includes('legal') || name.includes('law')) {
    return 'legal_consultation';
  } else if (name.includes('medical') || name.includes('health') || name.includes('doctor')) {
    return 'medical_consultation';
  } else if (name.includes('real estate')) {
    return 'real_estate_consultation';
  } else {
    return 'general_consultation';
  }
}

console.log(`Found ${newEvents.length} Calendly events to process`);

return newEvents.map(event => ({ json: event }));

// SongLabAI - Merge Event and Invitee Data
// Combine Calendly event data with invitee information

const eventData = $input.first().json;
const inviteeResponse = $input.last().json;

// Extract invitee information
let inviteeData = null;
if (inviteeResponse.collection && inviteeResponse.collection.length > 0) {
  const invitee = inviteeResponse.collection[0]; // Get first invitee

  inviteeData = {
    attendee_name: invitee.name,
    attendee_email: invitee.email,
    attendee_phone: null, // Not always available in free tier
    attendee_notes: null,
    invitee_uri: invitee.uri,
    payment_status: invitee.payment ? invitee.payment.status : null,
    timezone: invitee.timezone
  };

  // Try to extract phone from questions_and_answers if available
  if (invitee.questions_and_answers) {
    for (const qa of invitee.questions_and_answers) {
      if (qa.question.toLowerCase().includes('phone')) {
        inviteeData.attendee_phone = qa.answer;
      }
      if (qa.question.toLowerCase().includes('note') || qa.question.toLowerCase().includes('comment')) {
        inviteeData.attendee_notes = qa.answer;
      }
    }
  }
}

// Merge event and invitee data
const completeEventData = {
  ...eventData,
  ...inviteeData,

  // Add additional processing
  booking_source: 'email_link', // Default assumption
  needs_prospect_matching: true
};

return [{ json: completeEventData }];

